-- ----------------------------
-- View structure for abinfo
-- ----------------------------
DROP VIEW IF EXISTS `abinfo`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `abinfo` AS select `abb`.`id` AS `id`,`abb`.`time` AS `time`,`abb`.`abtype` AS `abtype`,`abb`.`videoid` AS `videoid`,`abb`.`userid` AS `userid`,`abb`.`carid` AS `carid`,`abb`.`remarks` AS `remarks`,`abb`.`checkstate` AS `checkstate`,`abb`.`checkremark` AS `checkremark`,`abb`.`mask` AS `mask`,`abb`.`bothhandsleavingwheel` AS `bothhandsleavingwheel`,`abb`.`eyesclosed` AS `eyesclosed`,`abb`.`nofacemask` AS `nofacemask`,`abb`.`notbucklingup` AS `notbucklingup`,`abb`.`smoke` AS `smoke`,`abb`.`notfacingfront` AS `notfacingfront`,`abb`.`cellphone` AS `cellphone`,`abb`.`yawning` AS `yawning`,`abb`.`headlowered` AS `headlowered`,`user`.`name` AS `name`,`user`.`avatarurl` AS `avatarurl`,`user`.`phone` AS `phone`,`user`.`leaderid` AS `leaderid`,`video`.`url` AS `url`,`car`.`licenseid` AS `licenseid`,`car`.`dutyofficerid` AS `dutyofficerid`,`car`.`type` AS `cartype`,`car`.`photo` AS `photo` from (((`user` join `car`) join `video`) join `abb`) where ((`abb`.`userid` = `user`.`id`) and (`abb`.`videoid` = `video`.`id`) and (`abb`.`carid` = `car`.`id`));

-- ----------------------------
