CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `userinfo` AS select `user`.`id` AS `id`,`user`.`username` AS `username`,`user`.`name` AS `name`,`user`.`driveyear` AS `driveyear`,`user`.`age` AS `age`,`user`.`leaderid` AS `leaderid`,`user`.`role` AS `role`,`user`.`phone` AS `phone`,`user`.`address` AS `address` from `user`;

