DROP TRIGGER IF EXISTS `外间`;
delimiter ;;
CREATE TRIGGER `外间` AFTER UPDATE ON `abtype` FOR EACH ROW BEGIN
		UPDATE abb,abtype
		SET abb.mask = abtype.mask 
	WHERE
		abb.abtype = abtype.abtype;
END
;;
delimiter ;

